laza en los campamentos de la THAM y te estas volviendo loco? No pasa nada. Trae a tus hij@s al campus de Rugby de Moralzarzal\\nConocerán gente nueva, un deporte hermoso y se lo pasarán Pipa. Ven a formar parte de nuestra familia\\n#Rugby #Moralzarzal #Campamento https://t.co/FTF9HsBB2e\",\"Username\":\"RugbyMoral\",\"Sentiment\":0.3},{\"Tweet_No\":\"6\",\"Date\":\"2021-06-07 19:14:05+00:00\",\"ID\":1401980800975970300,\"Content\":\"@Acrmoral @MarioCruz_Moral @HistoriadeMoral @osunajcr @MasMoralzarzal @MoralzarzalMas Le pago un #Trinaranjus que ponga una lista con más 5 poblaciones y menos de 10 donde haya un carril bici como el nuestro: estrechito, de un carril y contra el tráfico\\n#Consenso dice el otro, #movilidad... anda queee #PastoresdelMainstream #CarrildelTonto #Moralzarzal #Ridiculo\",\"Username\":\"eldelfregao\",\"Sentiment\":0},{\"Tweet_No\":\"7\",\"Date\":\"2021-06-07 16:53:04+00:00\",\"ID\":1401945316224639000,\"Content\":\"Inauguramos la I Semana de la Salud y el Bienestar de #Moralzarzal con una sesión de Body Combat #MoralSaludable https://t.co/hxucQBs0fM\",\"Username\":\"Moralzarzal\",\"Sentiment\":0},{\"Tweet_No\":\"8\",\"Date\":\"2021-06-07 16:43:04+00:00\",\"ID\":1401942795892445200,\"Content\":\"Buniatis Cleb, Campeón Liga de F7 #Moralzarzal 2021. El equipo ganador  y Kamikaze Fc tuvieron que llegar a la tanda de penaltis https://t.co/rvqgTsWdxV https://t.co/9KedhkTo1H\",\"Username\":\"Moralzarzal\",\"Sentiment\":0.5},{\"Tweet_No\":\"9\",\"Date\":\"2021-06-06 18:28:56+00:00\",\"ID\":1401607050522730500,\"Content\":\"La Sierra de Guadarrama luciendo en la primavera avanzada. \\n#moralzarzal #vacas #carne #ganaderia #sostenibilidad \\n#picodelAguila https://t.co/UwR1qU4zWQ\",\"Username\":\"angelmartinezx2\",\"Sentiment\":-0.3},{\"Tweet_No\":\"10\",\"Date\":\"2021-06-06 10:49:34+00:00\",\"ID\":1401491447837245400,\"Content\":\"En #Moralzarzal la naturaleza invade el espacio urbano por el descuido de limpieza viaria por parte de los servicios muni